import './im'
const App=()=>{
    return(
        <>
        <div className="split left">
            <div className="centered">
                <img src="D:\reacttut\Assignment\appone\images\img1.jpg" alt="Avatar man"></img>
                <h1>hi nisha</h1>
            </div>
        </div>
        <div className="split right">
            <div className="centered">
                <h1>hi nisha</h1>
            </div>
        </div>
        </>
    )
}
export default App;
